def find_clumps(Genome, k, L, t):
    clumps = set()  # 결과를 저장할 집합 (중복 방지)

    # 슬라이딩 윈도우를 사용하여 L 길이의 구간을 확인
    for i in range(len(Genome) - L + 1):
        window = Genome[i:i + L]  # 길이 L의 서브스트링 추출
        freq_map = {}  # k-mer 빈도를 저장할 딕셔너리

        # k-mer 빈도 계산
        for j in range(L - k + 1):
            kmer = window[j:j + k]
            freq_map[kmer] = freq_map.get(kmer, 0) + 1

        # t번 이상 등장하는 k-mer 찾기
        for kmer, count in freq_map.items():
            if count >= t:
                clumps.add(kmer)

    return clumps

# 테스트 데이터
Genome = ""
k, L, t = 11, 524, 20

# 결과 출력
result = find_clumps(Genome, k, L, t)
print(" ".join(sorted(result)))  # 사전순 정렬하여 출력
